const Statistic = ({ good, neutral, bad }) => {
    if(good || neutral || bad)
    {
        return (
            <div>
                <p>Good: {good}</p>
                <p>Neutral: {neutral}</p>
                <p>Bad: {bad}</p>
            </div>
        )
    }
    else{
        return (
            <p>No feedback given</p>
        )
    }
}

export default Statistic;
